import React,{ useState, useEffect } from 'react'
import GooglePlacesAutocomplete from "react-google-places-autocomplete"

const GoogleMapAutocomplete = () => {
    const [data, setData] = useState("");

  
    useEffect(() => {
      data === "" ? setData("") : setData(data);
    }, [data]);
 console.log(data)
  
    return (
      <GooglePlacesAutocomplete
        apiKey='AIzaSyC4wk5k8E6jKkpJClZlXZ8oavuPyi0AMVE'
        selectProps={{
          defaultInputValue: data, //set default value
          onChange: setData, //save the value gotten from google
          onfocus: data.label,
          placeholder: "Select Location",
          styles: {
            input: (provided) => ({
              ...provided,
              color: "#222222",
            }),
            option: (provided) => ({
              ...provided,
              color: "#222222",
            }),
            singleValue: (provided) => ({
              ...provided,
              color: "#222222",
            }),
          },
        }}
        onLoadFailed={(error) => {
          console.log(error);
        }}
      />
    );
  };
  

  

export  {GoogleMapAutocomplete}
